import { useEffect, useState } from "react";
import { fetchData } from "../../API";

export const Body = () => {
  const [data, setData] = useState([]);

  useEffect(() => {
    // for (let id = 1; id < 30; id++) {
    // }
    fetchData(data, setData);
  }, []);

  data && console.log(data);

  return (
    data &&
    <o>
      data.map((entry) => (
        <div key={entry.title} className="bg-coffee-l px-1">
          <li>{entry.title}</li>
        </div>
      ))
    </o>
  );
};
